import React, { PureComponent } from "react";
import "./App.css";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";
import {
  cycleData,
  nnData,
  baseData,
  totalData,
  TOTAL_PROGRAM_MEMORY,
  TOTAL_DYNAMIC_MEMORY
} from "./memoryData";
import MemoryBarChart from "./MemoryBarChart";

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/90v76x08/";

  render() {
    return (
      <div>
        <MemoryBarChart
          data={nnData}
          heavyFillColor="#65bfe0"
          lightFillColor="#b3e8fc"
        />
        <MemoryBarChart
          data={baseData}
          heavyFillColor="#65bfe0"
          lightFillColor="#b3e8fc"
        />
      </div>
    );
  }
}
